import React, {useEffect, useState} from 'react';

import { List } from 'antd'
import Item from "../components/Item";
import { Game } from "../types";
import { Center } from "../hoc/Center"
import { socketio } from '../socket'


function Home() {

    const gameList: Game[] = [
        {
            id: 1,
            creator: "Player 1"
        },
        {
            id: 2,
            creator: "Player 2"
        },
        {
            id: 3,
            creator: "Player 3"
        }
    ]

    useEffect(() => {
        socketio.on('connect', () => {
            console.log('connected')
        });

        socketio.on('disconnect', () => {
            console.log('disconnected')
        });

        socketio.on('games', (data: any) => {
            console.log(JSON.parse(data))
        });

    }, [])


    const [game, setGame] = useState<Game[]>(gameList)

    return (
        <>
            <Center>
                <List
                    header={<div style={{ textAlign: 'center' }}>Список ігор</div>}
                    footer={<div style={{ textAlign: 'center' }}>Хрестики нолики онлайн</div>}
                    bordered
                    dataSource={game}
                    renderItem={(item: Game) => (
                        <List.Item>
                            <Item {...item}/>
                        </List.Item>
                    )}
                />
            </Center>
        </>
    );
}

export default Home;
